                                        <Form.Control as="textarea" rows={3} onClick={(e)=>{
                                            let aa = e.target.value;
                                            console.log(aa.indexOf('\\'));
                                            console.log(aa.split("\\"));
                                            console.log(aa);

                                        }}/>
                                    </Col>
                                </Row>
                            </Card>
                        </Col>
                    </Row>
                </Container>
            </main>
        </div>
    );
}


